import * as React from "react";

import {
    StyleSheet,
    View,
    Button,
    Text,
    ScrollView,
    TouchableOpacity,
    TextInput,
    Image,
} from "react-native";

export default class CredScreen extends React.Component {

    constructor(props) {
      super(props)

      this.state = {
        creds: []
      };
    }

    render() {
      return (
        <View style={styles.container}>
          <Text
            style={{
              color: "black",
              fontSize: 28,
              textAlign: "center",
              marginTop: 35,
            }}
          >
            credential 1 <Ionicons name="md-book" size={32} color="blue" />
          </Text>
          <Image
            source={{ uri: "https://i.imgur.com/TkIrScD.png" }}
            style={{
              width: 305,
              height: 159,
              marginTop: 40,
              marginLeft: 30,
            }}
          />
          <Text
            style={{
              color: "black",
              fontSize: 18,

              marginTop: 35,
            }}
          >
            Name: Credential 1 <Ionicons name="md-book" size={32} color="blue" />
          </Text>
          <Text
            style={{
              color: "black",
              fontSize: 18,

              marginTop: 35,
            }}
          >
            Issued by: <Ionicons name="md-book" size={32} color="blue" />
          </Text>
          <Text
            style={{
              color: "black",
              fontSize: 18,

              marginTop: 35,
            }}
          >
            Email ID: <Ionicons name="md-book" size={32} color="blue" />
          </Text>
          <Text
            style={{
              color: "black",
              fontSize: 18,

              marginTop: 35,
            }}
          >
            DID:
            <Ionicons name="md-book" size={32} color="blue" />
          </Text>
          <Text
            style={{
              color: "black",
              fontSize: 18,

              marginTop: 35,
            }}
          >
            Shared With:
            <Ionicons name="md-book" size={32} color="blue" />
          </Text>
          <Text
            style={{
              color: "black",
              fontSize: 18,

              marginTop: 35,
            }}
          >
            Issued On:
            <Ionicons name="md-book" size={32} color="blue" />
          </Text>

          <TouchableOpacity
            style={styles.button}
            onPress={() => navigation.push("Cred")}
          >
            <Text style={styles.buttonText}>
              Done{" "}
              <Ionicons
                name="md-checkmark"
                size={20}
                marginLeft={25}
                color="#fff"
              />
            </Text>
          </TouchableOpacity>
        </View>
      );
    }
  }
